export default StyleSheet.create({
    conteiner: {
        flex: 1,
        alignItems:'center',
        justifyContent:'center'
    },
    direita: {
        backgroundColor: 'red' ,
        borderRadius: 8 ,
        right: 30,
    },
    esquerda: {
        backgroundColor: 'red' ,
        borderRadius: 8 ,
        left: 30,
    }
})
